import React, { useState } from 'react';
import Tesseract from 'tesseract.js';

export default function OcrUploader({ onParsed }) {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [rawText, setRawText] = useState('');

  const handleFile = async (e) => {
    const file = e.target.files?.[0];
    if (!file) return;

    setError('');
    setRawText('');
    setLoading(true);

    try {
      const { data: { text } } = await Tesseract.recognize(file, 'kor+eng', {
        logger: (m) => {},
      });

      setRawText(text);
      const parsed = parseTextToOrders(text);
      onParsed(parsed);
    } catch (err) {
      console.error('OCR error:', err);
      setError('OCR 처리 중 오류가 발생했습니다.');
      onParsed([]);
    } finally {
      setLoading(false);
    }
  };

  function parseTextToOrders(text) {
    if (!text || typeof text !== 'string') return [];

    const normalized = text.replace(/\r\n/g, '\n').trim();
    const blocks = normalized.split(/\n{2,}/).map(b => b.trim()).filter(Boolean);

    const orders = [];

    const getValue = (block, key) => {
      const re = new RegExp(`${key}\\s*[:：]?\\s*(.+)`, 'i');
      const lines = block.split('\n');
      for (let line of lines) {
        const m = line.match(re);
        if (m && m[1]) return m[1].trim();
      }
      return null;
    };

    blocks.forEach(block => {
      const orderId = getValue(block, '주문\\s*ID') || getValue(block, '주문ID');
      const userId = getValue(block, '사용자\\s*ID') || getValue(block, '사용자ID');
      const orderDate = getValue(block, '주문\\s*날짜') || getValue(block, '주문날짜');
      const status = getValue(block, '상태');
      let totalAmount = getValue(block, '총\\s*금액') || getValue(block, '총금액');

      if (totalAmount) {
        totalAmount = totalAmount.replace(/원/g, '').replace(/,/g, '').trim();
        const m = totalAmount.match(/[\d]+/);
        totalAmount = m ? m[0] : totalAmount;
      }

      if (orderId || userId || orderDate || status || totalAmount) {
        orders.push({
          orderId: orderId || '',
          userId: userId || '',
          orderDate: orderDate || '',
          status: status || '',
          totalAmount: totalAmount || '',
        });
      }
    });

    if (orders.length === 0) {
      const pattern = new RegExp(
        [
          '주문\\s*ID\\s*[:：]?\\s*([^\\n\\r]+)[\\s\\S]*?',
          '사용자\\s*ID\\s*[:：]?\\s*([^\\n\\r]+)[\\s\\S]*?',
          '주문\\s*날짜\\s*[:：]?\\s*([^\\n\\r]+)[\\s\\S]*?',
          '상태\\s*[:：]?\\s*([^\\n\\r]+)[\\s\\S]*?',
          '총\\s*금액\\s*[:：]?\\s*([^\\n\\r]+)'
        ].join(''),
        'gmi'
      );

      let match;
      while ((match = pattern.exec(normalized)) !== null) {
        let [, oId, uId, oDate, st, ta] = match;
        if (ta) {
          ta = ta.replace(/원/g, '').replace(/,/g, '').trim();
          const mm = ta.match(/[\d]+/);
          ta = mm ? mm[0] : ta;
        }
        orders.push({
          orderId: (oId || '').trim(),
          userId: (uId || '').trim(),
          orderDate: (oDate || '').trim(),
          status: (st || '').trim(),
          totalAmount: ta || '',
        });
      }
    }

    return orders;
  }

  return (
    <div className="ocr-uploader" style={{ margin: 12 }}>
      <label style={{ display: 'block', marginBottom: 8 }}>
        이미지 업로드 (주문 내역 이미지)
        <input type="file" accept="image/*" onChange={handleFile} style={{ display: 'block', marginTop: 8 }} />
      </label>

      {loading && <p>OCR 처리 중... (브라우저 리소스를 사용합니다)</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {rawText && (
        <details style={{ marginTop: 8, maxWidth: 800 }}>
          <summary>OCR 원문 보기</summary>
          <pre style={{ whiteSpace: 'pre-wrap', wordBreak: 'break-word', background: '#fafafa', padding: 8 }}>
            {rawText}
          </pre>
        </details>
      )}
    </div>
  );
}
